// import { LockClosedIcon } from "@heroicons/react/20/solid";
import { useContext, useState } from "react";
import { Link, useNavigate } from "react-router-dom";
import AuthContext from "../AuthContext";
// import formbg from "../assets/formbg.png";
// import Dashboard from "./Dashboard";

function Login() {
  const [form, setForm] = useState({
    email: "",
    password: "",
  });

  const authContext = useContext(AuthContext);
  const navigate = useNavigate();


  const handleInputChange = (e) => {
    setForm({ ...form, [e.target.name]: e.target.value });
  };

  const authCheck = () => {
    setTimeout(() => {
      fetch("http://localhost:4010/api/login")
        .then((response) => response.json())
        .then((data) => {
          alert("Successfully Login");
          localStorage.setItem("user", JSON.stringify(data));
          authContext.signin(data._id, () => {
            console.log("User Authenticated");
            navigate("/");
          });
        })
        .catch((err) => {
          alert("Wrong credentials, Try again")
          console.log(err);
        });
    }, 30);
  };

  // const loginUser = (e) => {
  //   // Cannot send empty data
  //   if (form.email === "" || form.password === "") {
  //     alert("To login user, enter details to proceed...");
  //   } else {
  //     fetch("http://localhost:4010/api/login", {
  //       method: "POST",
  //       headers: {
  //         "Content-type": "application/json",
  //       },
  //       body: JSON.stringify(form),
  //     })
  //       .then((result) => {
  //         console.log("User login", result);
  //       })
  //       .catch((error) => {
  //         console.log("Something went wrong ", error);
  //       });
  //   }
  //   authCheck();
  // };


  // const handleSubmit = (e) => {
  //   e.preventDefault();
  // };
  const loginUser = async (e) => {
    e.preventDefault();  // This prevents the default form submission behavior.

    if (form.email === "" || form.password === "") {
      alert("Please enter both email and password to login.");
      return;
    }

    try {
      const response = await fetch("http://localhost:4011/api/login", {
        method: "POST",
        headers: {
          "Content-Type": "application/json",
        },
        body: JSON.stringify(form),
      });

      if (!response.ok) {
        throw new Error('Login failed. Please check your credentials and try again.');
      }

      const data = await response.json();
      alert("Successfully logged in!");
      localStorage.setItem("user", JSON.stringify(data));
      authContext.signin(data._id, () => {
        console.log("User Authenticated");
        navigate("/");
      });
    } catch (error) {
      alert(error.message);
      console.log("Login error:", error);
    }
  };


  return (
    <>

      <div className="grid grid-cols-1 sm:grid-cols-2 h-screen  items-center place-items-center">
        <div className="flex justify-center">


          <img src={require("../assets/Backgrounddocstanding (1).png")} alt="" />
        </div>
        <div className="w-full max-w-md space-y-8 p-10 rounded-lg">
          <div>
            <h2 className="mt-6 text-center text-3xl font-bold tracking-tight text-gray-900"> Meditrack</h2>
            <h2 className="mt-6 text-center text-3xl font-bold tracking-tight text-gray-900">
              Signin
            </h2>
            <p className="mt-2 text-center text-sm text-gray-600">

              <span
                className="font-medium text-indigo-600 hover:text-indigo-500"
              >

              </span>
            </p>
          </div>
          <form className="mt-8 space-y-6" onSubmit={loginUser}>
            {/* <input type="hidden" name="remember" defaultValue="true" /> */}
            <div className="-space-y-px rounded-md shadow-sm">
              <div>
                <label htmlFor="email-address" className="sr-only">
                  Email address
                </label>
                <input
                  id="email-address"
                  name="email"
                  type="email"
                  autoComplete="email"
                  required
                  className="relative block w-full rounded-t-md border-0 py-1.5 px-1.5 text-gray-900 ring-1 ring-inset ring-gray-300 placeholder:text-gray-400 focus:z-10 focus:ring-2 focus:ring-inset focus:ring-indigo-600 sm:text-sm sm:leading-6"
                  placeholder="Email address"
                  value={form.email}
                  onChange={handleInputChange}
                />
              </div>
              <div>
                <label htmlFor="password" className="sr-only">
                  Password
                </label>
                <input
                  id="password"
                  name="password"
                  type="password"
                  autoComplete="current-password"
                  required
                  className="relative block w-full rounded-b-md border-0 py-1.5 px-1.5 text-gray-900 ring-1 ring-inset ring-gray-300 placeholder:text-gray-400 focus:z-10 focus:ring-2 focus:ring-inset focus:ring-indigo-600 sm:text-sm sm:leading-6"
                  placeholder="Password"
                  value={form.password}
                  onChange={handleInputChange}
                />
              </div>
            </div>

            <div className="flex items-center justify-between">
              <div className="flex items-center">
                <input
                  id="remember-me"
                  name="remember-me"
                  type="checkbox"
                  className="h-4 w-4 rounded border-gray-300 text-indigo-600 focus:ring-indigo-600"
                />
                <label
                  htmlFor="remember-me"
                  className="ml-2 block text-sm text-gray-900"
                >
                  Remember me
                </label>
              </div>

              <div className="text-sm">
                <span
                  className="font-medium text-indigo-600 hover:text-indigo-500"
                >
                  Forgot your password?
                </span>
              </div>
            </div>

            <div>
              <button
                type="submit"
                className="group relative flex w-full justify-center rounded-md bg-indigo-600 py-2 px-3 text-sm font-semibold text-white hover:bg-indigo-500 focus-visible:outline focus-visible:outline-2 focus-visible:outline-offset-2 focus-visible:outline-indigo-600"
                onClick={loginUser}
              >
                <span className="absolute inset-y-0 left-0 flex items-center pl-3">
                  {/* <LockClosedIcon
                    className="h-5 w-5 text-indigo-500 group-hover:text-indigo-400"
                    aria-hidden="true"
                  /> */}
                </span>
                Sign in
              </button>
              <p className="mt-2 text-center text-sm text-gray-600">
                Or{" "}

                  Don't Have an Account? 
                  <span
                  className="font-medium text-indigo-600 hover:text-indigo-500"
                >
                  <Link to="/register"> Register now </Link>
                </span>
              </p>
            </div>
          </form>
        </div>
      </div>
    </>
  );
}

export default Login;
